import React from 'react';
import { NavLink } from 'react-router-dom';
import './Navigation.css'

import logo from '../../../assets/logo.svg'
import discover from '../../../assets/discover.svg';
import library from '../../../assets/library.svg';

import Input from '../Input/Input';


const Navigation = () => (
  <div className="Navigation">
    <div>
      <NavLink activeClassName="active" exact to='/'><img src={discover} alt=""/></NavLink>
      <NavLink activeClassName="active" to='/library'><img src={library} alt=""/></NavLink>
    </div>
    <div>
      <NavLink activeClassName="active" exact to='/'><img src={logo} alt=""/></NavLink>
    </div>
    <div>
      <span>search tab</span>
      <span>sign up</span>
    </div>
  </div>
);

export default Navigation;
